import React from "react";
import LocationItem from "../components/LocationItem/LocationItem";

export default function Locations({ data }) {
  const renderAllLocations = () => {
    return data.map((locations) => {
      return <LocationItem key={locations.id} {...locations} />;
    });
  };
  return (
    <div className="locations">
      <h1 className="locations__title">Check out all the locations here</h1>
      <div className="locations__container">
        <div className="locations__wrapper">
          <div>{renderAllLocations()}</div>
        </div>
      </div>
    </div>
  );
}
